import React from 'react';
import {Switch, Route, Link} from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

import Login from './components/login-component';

function App() {
  return (
    <Switch>
      <Route path="/login"
      render={(props) => (
        <Login {...props} login={Login} />
      )}
      />
    </Switch>
  )
}

export default App;
